# OEIS sequence: A161978

def A161978(n):
    b,i = bin(n)[2:],-1
    r = b[::-1]
    s = r.index('1')
    while n:
        i += 1
        k = bin(n+i)[2:]
        if k.find(b) != -1:
            if k.find(r[s:]) != -1: break
    return n+i # _John Tyler Rascoe_, Mar 11 2023

